import styled from "styled-components";

const LoginButtonStyled = styled.button`
  width: 6em;
  height: 2.5em;
  border: none;
  font-size: 1em;
  font-weight: bold;
  background: #2f3640;
  color: #f5f6fa;
  border-radius: 5px;
  transition: 500ms;
  &:hover {
    color: #e84118;
    transition: 500ms;
  }
`;

export default LoginButtonStyled;
